import React from 'react';
import mujer from './assets/mujerfuerte.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={mujer} className="App-logo" alt="logo" />
        <h1>HER WAY</h1>

      </header>
    </div>
  );
}

export default App;
